import moment from "moment";
import React, { useState } from "react";
import { Calendar, momentLocalizer } from 'react-big-calendar';
import { Body, FormEvent, InputEvent } from "./styled";


const Agenda = () => {
    const [myEventsList, setMyEventsList] = useState([
        {
            'title': 'My event',
            'allDay': false,
            'start': new Date(2022, 6, 10, 10, 0), // 10.00 AM
            'end': new Date(2022, 6, 10, 14, 0), // 2.00 PM 
          }
    ])


    const localizer = momentLocalizer(moment)

    return(
    <Body>
        <Calendar
      localizer={localizer}
      events={myEventsList}
      startAccessor="start"
      endAccessor="end"
      style={{ height: 500 , width: 800}}
        />
    <FormEvent>
        <InputEvent></InputEvent>
    </FormEvent>
    </Body>
    )
}

export default Agenda;
